import React from 'react';
import './Home.css';

const HomePage = () => {
  return (
    <div className="homepage">
      <div className="homepage-header">
        <h2 className="title"> Devs On Deck</h2>
        <p className="subtitle">Your platform for connecting developers and job opportunities.</p>
        <div className="search-bar">
          <input type="text" placeholder="Search for jobs or companies..." />
          <button>Search</button>
        </div>
      </div>
      <div className="featured-jobs">
  <h3>Featured Jobs</h3>
  <div className="job-list">
    {[
      { title: "Frontend Developer", company: "Tech Corp", location: "Remote" },
      { title: "Backend Engineer", company: "CodeBase Inc.", location: "San Francisco" },
      { title: "Data Analyst", company: "Analytics Hub", location: "New York" }
    ].map((job, index) => (
      <div className="job-card" key={index}>
        <h4>{job.title}</h4>
        <p>{job.company}</p>
        <p>{job.location}</p>
        <button>Apply Now</button>
      </div>
    ))}
  </div>
</div>
      
    </div>
  );
};

export default HomePage;
